import React from 'react';
import TodoItem from "./TodoItem"
import todosData from "./todosData"

function App() {

  const item=todosData.map(i => <TodoItem key={i.id} it={i}/>)

  return (
    <div className="todo-list">
        {item}
    </div>
  );
}

export default App;
